description:
Endstation der Sehnsuchte

Sociopolitical Documentary hosted by Sung Hyung Cho, published by ZDF in 2009 - English narration


Information
------------------------------

Returning to the country of their birth, three Korean women, all with German husbands after thirty years abroad, discover their homeland is no longer their home. Retreating to the comforts of a German ghetto, complete with tiled roofs and bockwurst vendors, each must learn to balance cultures with grace and humor.

